CREATE TABLE ad_campaign(
   id             BIGINT  NOT NULL PRIMARY KEY AUTO_INCREMENT
  ,name           VARCHAR(50) NOT NULL
  ,image_url      VARCHAR(300) NOT NULL
  ,landing_url    VARCHAR(300) NOT NULL
  ,weight         INTEGER  NOT NULL
  ,target_country VARCHAR(2) NOT NULL
  ,target_gender  VARCHAR(1)
  ,reward         INTEGER  NOT NULL
);

create table ad_reward
(
    user_id      decimal(38) not null
        primary key,
    create_at    datetime(6) null,
    reserve_fund decimal(38) null,
    update_at    datetime(6) null,
    version      bigint      null
);

create table ad_reward_history
(
    id           decimal(38) not null
        primary key,
    create_at    datetime(6) null,
    reserve_fund decimal(38) null,
    user_id      decimal(38) null,
    ad_id        decimal(38) null,
    constraint FKpnlxhhp9h4p6nitw465a0amnd
        foreign key (user_id) references ad_reward (user_id)
);

